import './App.css';

function App() {
  let name = window.prompt("Enter your name: ");
alert("Your name is " + name);
    const [count, setCount] = useState(0);
    return (
      <div>
        <p>You clicked {count} times</p>
        <button onClick={() => setCount(count + 1)}>

          Click me
        </button>
      </div>
    );
  }

export default App;
